	public static int num;
	public static int cal(int[] a)
	{
		int i;
		int j;
		if (a[0] == -1)
		{
			return 0;
		}
		else
		{
			for (i = 0;i <= num;i++)
			{
				if (a[i] == 0)
				{
					for (j = i;j >= 0;j--)
					{
						if (a[j] == 1)
						{
							System.out.printf("%d %d\n",j,i);
							a[i] = -1;
							a[j] = -1;
							cal(a);
						}
					}
				}
			}
		}
		return 0;
	}
	public static int Main()
	{
		char x;
		char y;
		int k;
		String tempVar = ConsoleInput.scanfRead(null, 1);
		if (tempVar != null)
		{
			x = tempVar.charAt(0);
		}
		for (k = 1;k <= 10000;k++)
		{
			String tempVar2 = ConsoleInput.scanfRead(null, 1);
			if (tempVar2 != null)
			{
				y = tempVar2.charAt(0);
			}
			if (y == '\n')
			{
				a[k] = -1;
				num = k;
				break;
			}
			if (x == y)
			{
				a[k] = 1;
			}
			else
			{
				a[k] = 0;
			}
		}
		cal(a);
		return 0;
	}

